import logo from "../images/favicon.ico";

export function Navbar() {
  return (
    <div>
      <img src={logo}></img>
      <nav>
        <h3>ReactFacts</h3>
        <h4>React Course - Project 1</h4>
      </nav>
    </div>
  );
}
